;; gorilla-repl.fileformat = 1

;; **
;;; # Reading business cards
;;; 
;;; You are trying to highlights specific region of a business cards to send it to an OCR...
;;; 
;;; The default find contours just makes you crazy .. and you are not sure you want to play with OpenCV anymore ...
;;; this recipe is for you.
;; **

;; @@
(ns sunset-firefly
(:require
 [opencv3.core :refer :all]
 [opencv3.utils :as u]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Start by reading the bizcard as an image.
;; **

;; @@
(def original
  (-> "resources/images/bizcard.png"
  imread
  (u/resize-by 0.3)))

(u/mat-view original)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"300\" height=\"300\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x44ef251e \"BufferedImage@44ef251e: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@e1249da transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 300 height = 300 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; Let's naively find out what the contours are and draw them on a copy of the origina.
;; **

;; @@
(def contours 
  (new-arraylist))

(find-contours 
  (-> original clone (cvt-color! COLOR_RGB2GRAY)) 
  contours 
  (new-mat) 
  RETR_LIST CHAIN_APPROX_SIMPLE)

(def result
  (-> original clone))

(doseq [c contours]
  (let [ rect (bounding-rect c)]
     (do
      (rectangle result
       (new-point (.x rect) (.y rect ))
       (new-point (+ (.width rect) (.x rect)) (+ (.y rect) (.height rect)))
       (new-scalar 0 0 0)
       1
       ))))

(u/mat-view result)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"300\" height=\"300\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x35829cac \"BufferedImage@35829cac: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@e1249da transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 300 height = 300 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; Hmm .. that did not work whatsoever. There are so many contours that it just feels like you are drawing the letters themselves with rectangles ... let's try something else.
;;; We will blur the image before apply a binary threshold, and then dilate the result just a bit. 
;; **

;; @@
(def work
  (-> original
   clone
   (cvt-color! COLOR_RGB2GRAY)
   (gaussian-blur! (new-size 17 17) 50)
   (threshold! -1 255 (+ THRESH_BINARY_INV THRESH_OTSU))
   (dilate! (get-structuring-element MORPH_RECT (new-size 2 2)))))

(u/mat-view work)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"300\" height=\"300\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x3af9d9f4 \"BufferedImage@3af9d9f4: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@553b8b78 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 300 height = 300 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; **
;;; Then go back and find those contours again.
;; **

;; @@
(def contours 
  (new-arraylist))
(find-contours work contours (new-mat) RETR_LIST CHAIN_APPROX_SIMPLE)

(def result
  (clone original))

(doseq [c contours]
  (let [ rect (bounding-rect c)]
      (rectangle result
       (new-point (.x rect) (.y rect ))
       (new-point (+ (.width rect) (.x rect)) (+ (.y rect) (.height rect)))
       (new-scalar 0 0 0)
       1
       )))

(u/mat-view result )
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"300\" height=\"300\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6ad912c3 \"BufferedImage@6ad912c3: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@e1249da transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 300 height = 300 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; Almost there ... let's get rid of the small artefact at the top of the business card, by selecting contours with a bounding box bigger than a given size, here 15.
;; **

;; @@
(def result
  (clone original))

(doseq [c (filter #(> (.height (bounding-rect %)) 15) contours)]
  (let [ rect (bounding-rect c)]
      (rectangle 
        result
       (new-point (.x rect) (.y rect ))
       (new-point (+ (.width rect) (.x rect)) (+ (.y rect) (.height rect)))
       (new-scalar 0 0 0)
       1
       )))

(u/mat-view result)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"300\" height=\"300\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x5f2a615b \"BufferedImage@5f2a615b: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@e1249da transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 300 height = 300 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

